import React from 'react';
import ReactDOM from 'react-dom';
import { BluetoothProvider } from './BluetoothContext';

const App: React.FC = () => {
  return (
    <BluetoothProvider>
      <h1>ESP32 Bluetooth Communication</h1>
    </BluetoothProvider>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
